import React from "react";
import Webcam from 'react-webcam'

class Home extends React.Component {
     constructor() {
          super()
     }

     StartStream = () => {
          alert(123)
     }

     render() {
          return (
               <div style={{margin:'50px'}}>
                    <h1>Streamer online</h1>
                    <ul>
                         <li></li>
                    </ul>
                    <hr></hr>
                    <div>
                         <button onClick={this.StartStream}>Stream now !</button>
                         <div id='stream-screen'>
                              <Webcam />
                         </div>

                    </div>
               </div>
          )
     }
}

export default Home;
